import React from "react";
import LabelStyle1 from "../custom controls/labels/LabelStyle1";
import { useState } from "react";
import TextBoxStyle2 from "../custom controls/textBox/TextBoxStyle2";

export default function Test1(){
    const [position, setPosition] = useState(0);

  const toggleBox = () => {
    setPosition((prevPosition) => (prevPosition === 0 ? 1 : 0));
  };
    return(
      <div className="flex space-x-1 bg-red-300">
      <LabelStyle1 labelText="Email:" labelClassName="text-md w-auto" />
      <TextBoxStyle2 
        Name="email" 
        textBoxtype="email" 
        placeholder="example@gmail.com" 
        textBoxClassName="bg-green-200 border rounded-md shadow-sm flex-grow" 
      />
    </div>
    );
}
